import React from 'react';
import './App.css';


function Nav() {
  return (
    <nav>
        <h3>Logo</h3>
        <ul>
            <li>Home Page</li>
            <li>Login Page</li>
        </ul>
    </nav>
  );
}
/* Navigation */
export default Nav;
